import React from "react";
import "./NavBar.css";


function Navbar(props) {
  return (
    <div className="navbar navbar-fixed navbar-dark bg-primary">
    <form className="d-inline-block">
      <nav>
        <div className="nav-wrapper container">
          <h2 className="text-align-left">Clicky Game</h2>
          <h5 className="center white-text message">{props.text}</h5>
          <span className="text">
          <ul className=" ">
            <li style={{ paddingRight: "20px" }}>Score: {props.score}</li>
            <li style={{ paddingLeft: "20px" }}>Top Score: {props.topScore}</li>
          </ul>
          </span>
        </div>
      </nav>
      </form>
    </div>
  )
}



export default Navbar;
